void Fct_Bar_Init(int N_Bar,long x,long y,long Long_Bar,long Larg_Bar){
    P_Bar[N_Bar].x = x;
    P_Bar[N_Bar].y = y;
    P_Bar[N_Bar].Long_Bar = Long_Bar;
    P_Bar[N_Bar].Larg_Bar = Larg_Bar;
}

void Fct_Bar(int N_Bar,long Pourcent_Bar){

    long Larg_base;
    long y_Base;
    
    Larg_base = P_Bar[N_Bar].Larg_Bar * 0.6;
    y_Base = P_Bar[N_Bar].y + (P_Bar[N_Bar].Larg_Bar - Larg_base)/2;    

    cmd(BEGIN(RECTS));

    cmd(COLOR_RGB(180,180,180));
    cmd(VERTEX2F(P_Bar[N_Bar].x,y_Base));
    cmd(VERTEX2F(P_Bar[N_Bar].x + P_Bar[N_Bar].Long_Bar,y_Base+Larg_base));

//    static double Valeur_Progresse;
    static int Valeur_Progresse_Vert;
    static int Valeur_Progresse_Jaune;
    static int Valeur_Progresse_Rouge; 
    long Larg_Bar_60_pourcent = P_Bar[N_Bar].Long_Bar*0.6;
    long Larg_Bar_80_pourcent = P_Bar[N_Bar].Long_Bar*0.8;
    long Larg_Bar_20_pourcent = P_Bar[N_Bar].Long_Bar*0.2;
    long Valeur_Progress = (Pourcent_Bar * P_Bar[N_Bar].Long_Bar)/100;
    
    if(Valeur_Progress >= 0)
    {
        Valeur_Progresse_Vert = Valeur_Progress;
    
    
        if((Valeur_Progress > max[N_Bar])||(Time_max[N_Bar] == 0))
        {
            max[N_Bar] = Valeur_Progress;

            Time_max[N_Bar] = 20;
        }
        Time_max[N_Bar]--;
    
    
        if(max[N_Bar] <= Larg_Bar_60_pourcent)
        {
            cmd(COLOR_RGB(0,255,0));//Bar R verte claire fond
        }
        else if((max[N_Bar] > Larg_Bar_60_pourcent)&&(max[N_Bar] <= Larg_Bar_80_pourcent))
        {
            cmd(COLOR_RGB(255,255,0));//Bar R jaune claire fond
        }
        else if(max[N_Bar] > Larg_Bar_80_pourcent)
        {
            if(max[N_Bar] > P_Bar[N_Bar].Long_Bar)
            {
                max[N_Bar] = P_Bar[N_Bar].Long_Bar;
            }
            cmd(COLOR_RGB(255,0,0));//Bar R jaune claire fond
        }
        if(max[N_Bar] > 100)
        {    
            cmd(VERTEX2F(P_Bar[N_Bar].x + max[N_Bar]-100,P_Bar[N_Bar].y));
            cmd(VERTEX2F(P_Bar[N_Bar].x + max[N_Bar], P_Bar[N_Bar].y + P_Bar[N_Bar].Larg_Bar));
        }
    }

    if(Valeur_Progress >= Larg_Bar_60_pourcent)
    {
        Valeur_Progresse_Vert = Larg_Bar_60_pourcent;
    }
    cmd(COLOR_RGB(0,255,0));//Bar R verte claire fond
    cmd(VERTEX2F(P_Bar[N_Bar].x,P_Bar[N_Bar].y));
    cmd(VERTEX2F(P_Bar[N_Bar].x + Valeur_Progresse_Vert, P_Bar[N_Bar].y + P_Bar[N_Bar].Larg_Bar));    
    if(Valeur_Progress > Larg_Bar_60_pourcent)
    {
        Valeur_Progresse_Jaune = Valeur_Progress - Valeur_Progresse_Vert;
        if(Valeur_Progress >= Larg_Bar_80_pourcent)
        {
            Valeur_Progresse_Jaune = Larg_Bar_20_pourcent;
        }

        cmd(COLOR_RGB(255,255,0));//Bar R jaune claire fond
        cmd(VERTEX2F(P_Bar[N_Bar].x+Larg_Bar_60_pourcent,P_Bar[N_Bar].y));
        cmd(VERTEX2F(P_Bar[N_Bar].x + Valeur_Progresse_Vert + Valeur_Progresse_Jaune, P_Bar[N_Bar].y + P_Bar[N_Bar].Larg_Bar));
    }
    if(Valeur_Progress > Larg_Bar_80_pourcent)
    {
        Valeur_Progresse_Rouge = Valeur_Progress - Valeur_Progresse_Vert - Valeur_Progresse_Jaune;
        if(Valeur_Progress >= P_Bar[N_Bar].Long_Bar)
        {
            Valeur_Progresse_Rouge = Larg_Bar_20_pourcent;
            Valeur_Progress = P_Bar[N_Bar].Long_Bar;
        }
        cmd(COLOR_RGB(255,0,0));//Bar R rouge claire fond
        cmd(VERTEX2F(P_Bar[N_Bar].x+ Larg_Bar_80_pourcent,P_Bar[N_Bar].y));
        cmd(VERTEX2F(P_Bar[N_Bar].x + Valeur_Progresse_Vert + Valeur_Progresse_Jaune + Valeur_Progresse_Rouge, P_Bar[N_Bar].y + P_Bar[N_Bar].Larg_Bar)); 
    }
    
    cmd(COLOR_RGB(0,255,0));//Bar R verte claire fond
    cmd(VERTEX2F(P_Bar[N_Bar].x,P_Bar[N_Bar].y ));
    cmd(VERTEX2F(P_Bar[N_Bar].x + Valeur_Progresse_Vert, P_Bar[N_Bar].y + P_Bar[N_Bar].Larg_Bar));
    
    cmd(COLOR_RGB(0,0,0));
    int i;
    int j = 21;//Nb separateur;
    for(i = 0; i < j; i ++)
    {
        double L_Separat = 0.004 * P_Bar[N_Bar].Long_Bar;//largeur separateur
        if(L_Separat < 1)
        {
            L_Separat = 1;
        }
        int Space = P_Bar[N_Bar].Long_Bar/(j-1);
        int Ref_Space = (P_Bar[N_Bar].x + i * Space);

        cmd(VERTEX2F(Ref_Space,P_Bar[N_Bar].y));
        cmd(VERTEX2F(Ref_Space+(long)L_Separat, P_Bar[N_Bar].y + P_Bar[N_Bar].Larg_Bar));   
    }
    cmd(VERTEX2F(P_Bar[N_Bar].x, P_Bar[N_Bar].y  -5)); 
    cmd(VERTEX2F(P_Bar[N_Bar].x + P_Bar[N_Bar].Long_Bar,P_Bar[N_Bar].y )); 

    cmd(VERTEX2F(P_Bar[N_Bar].x, P_Bar[N_Bar].y + P_Bar[N_Bar].Larg_Bar-5)); 
    cmd(VERTEX2F(P_Bar[N_Bar].x + P_Bar[N_Bar].Long_Bar,P_Bar[N_Bar].y + P_Bar[N_Bar].Larg_Bar)); 
    
    
    END();
    

}

    
void Fct_BTN_Init(int N_BTN,int FG_Color1,int FG_Color2,int Color_txt,int x,int y ,int w,int h,int T_Txt,char *txt_BTN){
    

    P_BTN[N_BTN].FG_Color1 = FG_Color1;
    P_BTN[N_BTN].FG_Color2 = FG_Color2;
    P_BTN[N_BTN].Txt_Color = Color_txt;
    P_BTN[N_BTN].x = x;
    P_BTN[N_BTN].y = y;
    P_BTN[N_BTN].W_BTN = w; 
    P_BTN[N_BTN].H_BTN = h;
    P_BTN[N_BTN].Taille_Txt = T_Txt;
    //P_BTN[N_BTN].Txt = );
    strcpy(P_BTN[N_BTN].Txt,txt_BTN);
    //char* test = malloc(20);
    Nop();

}

void Check_BTN(int N_BTN,T_Action_BTN Mode){
    
    switch(Mode)
    {
        case BTN_ON:
        {
            Mem_BTN[N_BTN] = BTN_ON;
            break;
        }
        case BTN_OFF:
        {
            Mem_BTN[N_BTN] = BTN_OFF;
            break;
        }
        case BTN_TOGGLE:
        {
            if(Mem_BTN[N_BTN] == 1)
            {
                Mem_BTN[N_BTN] = 0;
            }
            else
            {
                Mem_BTN[N_BTN] = 1;
            }

            break;
            
        }

    }
}

int Affichage_BTN(int N_BTN,T_BTN Mode){
    int BTN_Presse;
    Separate_color Txt;

    Txt.Global_Color = P_BTN[N_BTN].Txt_Color;

    cmd(TAG(N_BTN));
    switch(Mode)
    {
        case ONE_CLICK:
        {
            cmd_fgcolor(P_BTN[N_BTN].FG_Color1);
            cmd(COLOR_RGB(Txt.color.Red,Txt.color.Grun,Txt.color.Blue)); 
            if(rd8(REG_TOUCH_TAG) == N_BTN)//Si Bouton presser
            {       
                cmd_button(P_BTN[N_BTN].x, P_BTN[N_BTN].y,P_BTN[N_BTN].W_BTN,P_BTN[N_BTN].H_BTN, P_BTN[N_BTN].Taille_Txt,OPT_FLAT,P_BTN[N_BTN].Txt);  
            }
            else
            {
                cmd_button(P_BTN[N_BTN].x, P_BTN[N_BTN].y,P_BTN[N_BTN].W_BTN,P_BTN[N_BTN].H_BTN, P_BTN[N_BTN].Taille_Txt, 0,P_BTN[N_BTN].Txt);   
            }
            
            if((rd8(REG_TOUCH_TAG) != N_BTN)&&(Rebond[N_BTN] == N_BTN))//Si Bouton relaché
            {        
                BTN_Presse = 1;
            }
            else
            { 
                BTN_Presse = 0;
            }
            break;            
        }
        case TOGGLE:
        {
            cmd(COLOR_RGB(Txt.color.Red,Txt.color.Grun,Txt.color.Blue));  
            if((rd8(REG_TOUCH_TAG) != N_BTN)&&(Rebond[N_BTN] == N_BTN))//Si Bouton relaché
            {                  
                if(Mem_BTN[N_BTN] == 1)
                {
                    Mem_BTN[N_BTN] = 0;
                    BTN_Presse = 0;
                }
                else
                {
                    Mem_BTN[N_BTN] = 1;
                    BTN_Presse = 1;
                }
            }
            if(Mem_BTN[N_BTN] == 0)
            {
                cmd_fgcolor(P_BTN[N_BTN].FG_Color2); 
            }
            else
            {
                cmd_fgcolor(P_BTN[N_BTN].FG_Color1);                                  
            }
            
            
            if(rd8(REG_TOUCH_TAG) == N_BTN)//Si Bouton presser
            {
                cmd_button(P_BTN[N_BTN].x, P_BTN[N_BTN].y,P_BTN[N_BTN].W_BTN,P_BTN[N_BTN].H_BTN, P_BTN[N_BTN].Taille_Txt,OPT_FLAT,P_BTN[N_BTN].Txt);
            }
            else
            {
                cmd_button(P_BTN[N_BTN].x, P_BTN[N_BTN].y,P_BTN[N_BTN].W_BTN,P_BTN[N_BTN].H_BTN, P_BTN[N_BTN].Taille_Txt,0,P_BTN[N_BTN].Txt);
            }
            break;
        }    
        case MODE_ON :
        {
//            Mem_BTN[N_BTN] = 1;//suppression pour Test (16.02.2018)
            cmd_fgcolor(P_BTN[N_BTN].FG_Color1);
            cmd_button(P_BTN[N_BTN].x, P_BTN[N_BTN].y,P_BTN[N_BTN].W_BTN,P_BTN[N_BTN].H_BTN, P_BTN[N_BTN].Taille_Txt,0,P_BTN[N_BTN].Txt);
            break;
        }
        case MODE_OFF :
        {
//            Mem_BTN[N_BTN] = 0;//suppression pour Test (16.02.2018)
            cmd_fgcolor(P_BTN[N_BTN].FG_Color2);
            cmd_button(P_BTN[N_BTN].x, P_BTN[N_BTN].y,P_BTN[N_BTN].W_BTN,P_BTN[N_BTN].H_BTN, P_BTN[N_BTN].Taille_Txt,OPT_FLAT,P_BTN[N_BTN].Txt);
            break;
        }

    }
    Rebond[N_BTN] = rd8(REG_TOUCH_TAG);
    cmd(TAG(255));

    return BTN_Presse;
}

void Change_Text_BTN(int N_BTN,char *Text_BTN){
    sprintf(P_BTN[N_BTN].Txt,Text_BTN);
}

void Change_Color_ON_BTN(int N_BTN,long Color){
    P_BTN[N_BTN].FG_Color1 = Color;
    
}

void Change_Color_OFF_BTN(int N_BTN,long Color){
    P_BTN[N_BTN].FG_Color2 = Color;
}





